    render(){
        return(
            <div>
               <div className='home-screen-header'>
                    <h4>Please Login</h4>
                </div>
                <div>
                    <form className="form" onSubmit={this.handleLogin}>
                        <input name="LoginName" value={this.state.name} onChange={this.handleChange} placeholder="Name" />
